import React, { PropsWithChildren } from 'react';

import { Container, Tag }  from './styles';

interface IMynaMonitoring {
    runColor: string;
    tagColor: string;
    title: string;
    subtitle: string;
    status: string;
}

const MynaMonitoring: React.FC<IMynaMonitoring> = ({
    tagColor, 
    title,
    subtitle,
    status
})  => {

    return (
        <Container color ={runColor}>
            <Tag color = {tagColor}/>
            <div>
                <span>{title}</span>
                <small>{subtitle}</small>
            </div>
            <h3>{status}</h3>
        </Container>
    );
}

export default MynaMonitoring;
